import pic from './logo.svg'
import { Link } from 'react-router-dom';
function Products(props) {
  return (
   
      <div className="card shadow p-3 mb-5 bg-body rounded " style={{ width: '18rem' }}>
        <img src={pic} className="card-img-top" alt="..." />
        <div className="card-body">
          <h5 className="card-title">{props.name}</h5>
          <p className="card-text">{props.disc}</p>
          <p><a href="/" className="btn btn-primary form-control">{props.price}</a></p>
          <Link to={`/Singlepage/${props.id}`} className='btn btn-success form-control' >Product Details...</Link>
        </div>
      </div>
  
  );
}

export default Products;
